}

class App extends React.Component<{}, AppState> {

  state: AppState = {
    activeBoard: <Board 
      boardName="Board "
      boardDueDate="01-10-2019"
    />,
  }

  render () {
    return (
      <div className="app">
        <Sidebar /> 
        <Board 
          boardName="Board "
          boardDueDate="01-10-2019"
        />;
      </div>
    );
  }

}

